Album Info

Get Ya Mind Correct is the debut album by rappers Paul Wall &amp; Chamillionaire of The Color Changin' Click, released when they were both on the Paid In Full Entertainment Label. This release was notable in the Houston underground rap scene after it managed to sell over 150,000 copies independently without the backing of a major label. The album was nominated for Indie Album of the Year in The Source magazine. There's a Chopped and Screwed version by DJ Michael '5000' Watts for Swishahouse
